import axios from 'axios';

const login = () =>{

    axios.get('/tokenauth', {
      headers: {
        'x-access-token': localStorage.getItem('token')
      }
    })
    .then(res => {
      console.log(res.data.username);
      return {username: res.data.username, success: res.data.success,};
    })
    .catch(err => {
      console.log(err);
      return {success: false};
    });
  }

export default login;
